import httpService from './axios.js'

const post = (url, params) => {
	return new Promise((resolve, reject) => {
		httpService.post(url, params).then(res => {
			resolve(res.data);
		}).catch(err => {
			reject(err);
		});
	});
}
const get = (url, params) => {
	return new Promise((resolve, reject) => {
		httpService.get(url, {
			params: params
		}).then(res => {
			resolve(res.data);
		}).catch(err => {
			reject(err)
		})
	});
}

export default {post,get};
